ひざねこ ちび マスコット ミニ ぬいぐるみ ボールチェーン ねこ サンレモン 手のひらサイズ かわいい キャラクターグッズ通販 【あす楽】シネマコレクション<BR><BR><!-- ★お気に入り--><div class="w280-c"><div class="center-m-0a"><img class="item-oki-bn" alt="キャラクターグッズ通販シネマコレクションのお気に入りリストを確認する" src="http://image.rakuten.co.jp/cinemacollection/cabinet/oki-2.gif"></div></div><!-- ★お気に入りココまで--><!--★削除不可--></span></td></tr></table><br></td></tr></table><br><table cellpadding="0" border="0"><tr><td><table cellpadding="0" border="0"><tr><td><span><!--関連検索キーワード--><div style="width:100%;text-align: center"><h3 style="color:#7f7f7f;">大人気!愛でるぬいぐるみ【ひざねこ】に小さな仲間が登場!!<br><!--★K-->ぬいぐるみ/手のひらサイズ/かわいい/ねこ/マスコット</h3><img style="margin:15px 0 10px 0;width:100% ;border:none;" alt="キャラクターグッズ専門店/シネマコレクション/商品詳細" src="http://www.rakuten.ne.jp/gold/cinemacollection/bn/item-bn01.gif" /><div style="color:#7f7f7f;width:90%;margin:0 auto;#efefef solid 1px;padding:10px;text-align: left;">いつまでもひざに乗せて撫でたくなる、新しいタイプの癒し系ぬいぐるみ【ひざねこ】に小さな仲間《ちび》が新登場!!<br>手のひらにちょこんと乗るサイズでひざの上にも並んじゃう♪<br>ボールチェーン付きなのでバッグなど小物にもつけることが出来ます。<br>目のパーツにもこだわり、奥に位置した黒目は、顔を見つめていると、奥ゆかしい瞳に吸い込まれそう…<br>本物の猫のお腹のような柔らか素材で手触りもバツグン!!<br>あなたのおそばにいつでもそっと寄り添います。<br><br>■サイズ：約55×170×90mm</div></div><div style="width:100%;text-align: center;"><img style="margin:15px 0 10px 0;width:100% ;border:none;" alt="キャラクターグッズ専門店/シネマコレクション/詳細画像" src="http://www.rakuten.ne.jp/gold/cinemacollection/bn/item-bn02.gif" /><div style="width:100%;margin:0 auto;"><img style="width:260px;margin:2px;border:none;" src="http://image.rakuten.co.jp/cinemacollection/cabinet/r20170222/slm-2702-42.jpg"><img style="width:260px;margin:2px;border:none;" src="http://image.rakuten.co.jp/cinemacollection/cabinet/r20170222/slm-2702-42_2.jpg"><img style="width:260px;margin:2px;border:none;" src="http://image.rakuten.co.jp/cinemacollection/cabinet/r20170222/slm-2702-42_3.jpg"><img style="width:260px;margin:2px;border:none;" src="http://image.rakuten.co.jp/cinemacollection/cabinet/r20170222/slm-2702-42_4.jpg"><img style="width:260px;margin:2px;border:none;" src="http